sample: '["\"schudnut z tvare\\nDec 27, 2013 - Aby sme predi\u0161li takmer z\u00e1konit\u00e9mu
  priberaniu po menopauze , treba za\u010da\u0165 intenz\u00edvnej\u0161ie po\u010d\u00fava\u0165
  hlas svojho tela. Ak sa stravujeme rovnako, ...\\nOct 9, 2015 - Schudn\u00fa\u0165
  m\u00f4\u017eete takmer 10 k\u00edl za 21 dn\u00ed. ... Starnutie a hormon\u00e1lne
  zmeny m\u00f4\u017eu najm\u00e4 v menopauze vies\u0165 k \u00fapln\u00e9mu zr\u00fateniu
  metabolizmu.\\nAk m\u00e1te nadv\u00e1hu a chcete schudn\u00fa\u0165 ,. Tuk Chudnutie
  v menopauze . Som dva roky po hysterektomii, pribrala som 15kg poradte ako schudn\u00fa\u0165
  . Tu je p\u00e4\u0165 pravidiel ...\\nMay 28, 2018 - Stra\u0161iak \u017eeny po
  40. roku \u017eivota, ale aj ak\u00fdsi pomyseln\u00fd prechod v \u017eivote do
  \u010fal\u0161ej f\u00e1zy, to je menopauza , niekedy naz\u00fdvan\u00e1 aj klimakt\u00e9rium.\\nMenopauza
  (klimakt\u00e9rium) - naj\u010dastej\u0161ie za\u010d\u00edna medzi 45-55 rokom
  \u017eivota \u017eeny. Je to be\u017en\u00fd jav, pri ktorom doch\u00e1dza k nedostato\u010dnej
  tvorbe estrog\u00e9nov a ...\\n30 jednoduch\u00fdch sp\u00f4sobov, ako schudn\u00fa\u0165
  prirodzene (Zalo\u017een\u00e9 na vedeck\u00fdch poznatkoch) Vypad\u00e1vanie vlasov
  po menopauze . Ak pri\u0161iel.\\nKlimakt\u00e9rium a hormon\u00e1lne zmeny v \u017eivote
  \u017eeny Menopauza je s\u00fa\u010das\u0165ou \u017eivota ka\u017edej \u017eeny
  \u010di u\u017e sk\u00f4r, alebo nesk\u00f4r. Pri menopauze doch\u00e1dza k zastaveniu
  ...\\nSlovo menopauza znamen\u00e1 po slovensky ukon\u010denie men\u0161tru\u00e1cie.
  Sk\u00f4r ne\u017e sa \u017eena dostane do menopauzy, prech\u00e1dza obdob\u00edm,
  ktor\u00e9 sa naz\u00fdva klimakt\u00e9rium ...\\nMar 5, 2012 - \u010co si da\u0165
  na ve\u010deru, ke\u010f sa sna\u017e\u00edte schudn\u00fa\u0165 \u00b7 Diva.sk
  7. 2 jablk\u00e1 denne udr\u017eia v\u00e1\u0161 cholesterol na uzde, a to aj cez
  sviatky. Ako? Najmama.sk ...\\nChcete schudn\u00fa\u0165 ? Jedzte zdravo a spr\u00e1vne.
  \u017dena v klimakt\u00e9riu podstupuje prechod medzi plodn\u00fdm a neplodn\u00fdm
  obdob\u00edm \u017eivota. Postupne sa za\u010d\u00edna zni\u017eova\u0165 ...\\nMenopauza
  a ve\u013ek\u00e9 brucho \u2013 klimakt\u00e9rium \u2013 pr\u00edznaky, vek, priberanie,
  ... Ak chcete r\u00fdchlo schudn\u00fa\u0165 , sk\u00faste najlep\u0161ie pr\u00e1\u0161ky
  na chudnutie OPC Traubenkern.\\nOct 17, 2018 - Pokia\u013e chcete \u00faspe\u0161ne
  schudn\u00fa\u0165 - zapojte do \u017eivota na\u0161e rady. ... Priberanie na v\u00e1he
  \u201ev\u010faka\u201c menopauze a nezvratn\u00fdm zmen\u00e1m v tele poc\u00edtili
  ...\\nJednou z ve\u013emi \u010dast\u00fdch t\u00e9m, ktor\u00e9 \u017eeny rozoberaj\u00fa
  nielen v\u0161eobecne, ale aj v obdob\u00ed prechodu, je chudnutie. Pri menopauze
  toti\u017e m\u00f4\u017eu, hlavne v d\u00f4sledku ...\\nMenopauza m\u00e1 v \u017eenskom
  \u017eivote r\u00f4zne \u00farovne d\u00f4le\u017eitosti. Uzatv\u00e1ra va\u0161e
  plodn\u00e9 obdobie a medzi riadkami v\u00e1m nastavuje \u010fal\u0161iu \u017eivotn\u00fa
  dek\u00e1du.\\nBudete \u0161t\u00edhla aj v menopauze ... Zist\u00edme, pre\u010do
