  tom informovala v nede\u013eu.\\nRusk\u00e9mu vojensk\u00e9mu vedeniu sa pod\u013ea
  spr\u00e1vy zalo\u017eenej na inform\u00e1ci\u00e1ch britsk\u00fdch tajn\u00fdch
