  Gennadij \u017didko.\\nOkrem zmien na najvy\u0161\u0161\u00edch velite\u013esk\u00fdch
  postoch pri\u0161lo najmenej desa\u0165 rusk\u00fdch gener\u00e1lov aj o \u017eivot
